La Pinetina di Appiano Gentile ti offre campi da calcio al coperto in erba sintetica di ultima generazione, con spogliatoi spaziosi e confortevoli. Immerso nel verde del Parco Pineta e servito da un comodo e ampio parcheggio. 
•4 campi da calcetto di cui 3 tensostrutture apribili lateralmente (campo 2,5,6) e 2 pressostatici coperti d’inverno e scoperti d’estate (campo 1);
•1 campo da tennis in mateco (tensostruttura apribile lateralmente);
•4 campi da Padel; 2 sotto una unica tensostruttura apribile lateralmente, coperta tutto l'anno, 2 con struttura pressostatica coperta d'inverno e scoperta d'estate;
Il centro sportivo offre a tutti i suoi clienti un bar aperto dalla mattina alla sera.

