I nostri nuovissimi campi da padel a Pogliano Milanese ti accoglieranno nella nostra struttura, con:
* 4 Campi indoor super panoramici con struttura in ferro;
* Impianto di riscaldamento/raffreddamento; 
* Spogliatoi con tutti i comfort (docce e armadietti compresi); 
* Parcheggio in cortile privato;
* Luce naturale anti-bagliore di giorno, super illuminazione dei campi con fari a Led di sera;
* Noleggio racchette per ogni livello di gioco.

